import React from 'react'
const logoProfile = new URL("../images/1.png", import.meta.url);
function About() {
  return (
    <div className="container">
      <div className="jumbotron text-center">
        <img src={logoProfile} alt="profile image" width={200} className="img-thumbnail" ></img>
        <h1 className='display-4'>Muhammad Syihabuddin</h1>
        <p className='lead'>Nim.190441100153</p>
        <span />
        <p>"Aplikasi ini dibuat menggunakan teknologi MERN STACK"</p>
      </div>
    
    </div>
  );
}

export default About
